import React from "react";

function SignUpDetails() {
  return (
    <div
      style={{
        height: "100%",
        width: "100%",
        backgroundColor: "skyblue",
        display: "flex",
      }}
    >
      <div
        style={{
          height: "100%",
          width: "45%",
          backgroundColor: "pink",
          textAlign: "right",
          paddingRight: "1.5vw",
          paddingLeft: "1vw",
          fontWeight:""
        }}
      >
        <p style={{ height: "20%", marginTop: "5vh" }}>Name</p>
        <p style={{ height: "20%" }}>Email</p>
        <p style={{ height: "20%" }}>Password</p>
        <p style={{ height: "20%" }}>Confirm Password</p>
      </div>
      <div style={{ height: "100%", width: "55%" }}>
        <p>Name</p>
        <p>Email</p>
        <p>Password</p>
        <p>Confirm Password</p>
      </div>
    </div>
  );
}

export default SignUpDetails;
